// routes.js
import React from 'react';
import { Routes, Route } from 'react-router-dom';
import PopisBodova from '../pages/PopisBodova'; // Ako je PopisBodova u istom direktoriju
import PopisDivljaci from '../pages/PopisDivljaci';

const AppRoutes = () => {
    return (
        <Routes>
            <Route path="/popis-bodova" element={<PopisBodova />} />
            <Route path="/popis-divljaci" element={<PopisDivljaci />} />
            {/* Dodajte druge rute ovdje kako se vaša aplikacija širi */}
        </Routes>
    );
};

export default AppRoutes;
